import React from 'react'

import { Grid } from '@material-ui/core'

import youtube from './api/youtube'

class App extends React.Component {
  render () {
    return(
      <Grid justify="center" container spacing={16}>
        <Grid itemxs={12}>
          <Grid container spacing={16}>
            <Grid item xs={12}>
              {/* SEARCH BAR*/}
            </Grid>
          </Grid>
          <Grid item xs={8}>
              {/* VIDEO DETAILS*/}
          </Grid>
          <Grid item xs={4}>
            {/* VIDEIO LIST */}
          </Grid>
        </Grid>
      </Grid>
    )
  }
}

export default App
